import React, { Component } from 'react';

class WebSiteTreeBuilder extends Component {
    create_json = () => {
        this.props.json = {};
        var list = this.props.url_list;
        for(var i=0; i < list.length; i++){
            var url = list[i];
            var split_list = url.split('/');
            for(var j=0; j<split_list.length; j++){
                continue;
            }
        }
    }
    render() {
        this.create_json();
        return (
                <div>
                    hello
                </div>
            );
        }
    }

export default WebSiteTreeBuilder;
